    description: >-
      <body>
                                  
      								<div style="position:absolute; top:0px; right:0px;">
                                        <img _title="This is a Popular File" alt="" class="ipsImage" data-ipstooltip="" src="https://www.simtropolis.com/library/misc/big-heart-icon.png" style="" width="34" height="53">
      								</div>























      							























      							
      <p> </p><div style="text-align:center;"><p><span style="color:#FF0000;"><strong>NOTE: You do not need this pack if you</strong><strong>already downloaded / plan to download the
      full</strong><br><strong>SIMPEG AGRICULTURAL MOD (SPAM)!</strong></span><br><br>This package is the main dependency for all things SPAM - from the main mod to most of the current or future
      additional sets. This standalone version is meant for all players who do not want to use the full mod but still wish to play with lots and items that utilize these props and
      textures.<br><br><br>The SPAM SUPER PACK combines all SPAM props and textures into a single download. However, it will install props and textures as separate files to make any uture updates
      easier and faster.<br><br><strong><span>INCLUDED</span></strong><br><br>* SPAM_Resource<br>All models and props used for the agricultural mod<br><br>* SPAM_Crops_Resource<br>All models and props
      for the seasonal crop varieties<br><br>* SPAM_Textures<br>All textures used in the agricultural mod</p><div style="text-align:center;"><p><span style="color:#FF0000;"><strong>NOTE: This pack
      includes no lots!</strong><br><strong>AGAIN: You do not need this pack if you</strong><br><strong>already downloaded / plan to download the full</strong><br><strong>SIMPEG AGRICULTURAL MOD
      (SPAM)!</strong></span></p><p><br>You can use all the material for your own lotting projects. However, you may not include any of these items with your uploads - please point to this pack as a
      dependency!<br><br><strong><span>DEPENDENCIES</span></strong><br><br>This dependency has no dependencies :-)<br><br>* The entire PEG SPAM collection is available on the <abbr title="Pegasus Lot
      Exchange">PLEX</abbr> (on the) <abbr title="Simtropolis Exchange">STEX</abbr>.<br><br><img class="ipsImage" alt="pdt_logo01.png"
      src="http://i211.photobucket.com/albums/bb210/abcvs/Pegasus%20Productions/pdt_logo01.png"></p></div></div><p style="line-height:22px;text-align:center;"><strong><span
      style="color:rgb(128,0,0);">All Pegasus files are now legacy content and are no longer officially supported - however support from the wider community can be requested</span> <u><a
      href="https://community.simtropolis.com/forums/topic/68471-plex-on-the-stex-community-support/">here.</a></u></strong></p>

      						</body>
